// Profile.js
import React from 'react';
import { useAuth } from '../../provider/AuthProvider';

const Profile = () => {
  const { user, logout,fetchprofile } = useAuth();

  return (

    <div>
      <h2>Welcome, {user && <p>{user.username}</p>}!</h2>
      <button onClick={logout}>Logout</button>
    </div>
  );
};

export default Profile;
